import React, { Component } from "react";
import axios from "axios";

export default class OrderTable extends Component {
  state = {
    orders: [],
  };
  render() {
    return (
      <div>
        <table className="table">
          <thead>
            <tr>
              <th scope="col">Heading</th>
            </tr>
          </thead>
          <tbody>
            {orders.map((item) => {
              return (
                <>
                  <tr key={item._id}>
                    <td>{item.item}</td>
                    <td></td>
                  </tr>
                </>
              );
            })}
          </tbody>
        </table>
      </div>
    );
  }
}
